import * as types from '../constants/ActionTypes';

var initialState = {};

var myReducer = (state = initialState, action) => {
    switch(action.type){
        case types.EDIT_TASK:
            state = {
                id: action.task.id,
                name: action.task.name,
                status: action.task.status
            }
            return state;
        default:
            return state;
    }
}

export default myReducer;
